function initGrid(selector, nRows, nCols, width, data) {
  let cellSize = Math.floor(width/nCols);

  let grid = d3.select(selector)
    .append("svg")
    .attr("width", width)
    .attr("height",nRows*cellSize);
      
    let row = grid.selectAll(".row")
    .data(data)
    .enter()
    .append("g")
    .attr("class", "row");

  let infoBox = grid.append("text")
      .attr('x', width - 30)
      .attr('y', 10)
      .attr('class','position')
    
  row.selectAll(".square")
    .data(function(d) { return d; })
    .enter()
    .append("rect")
    .attr("class", function(d) { return `square${d.alive ? ' alive' : ''}`;})
    .attr("x", function(d) { return d.x * cellSize; })
    .attr("y", function(d) { return d.y * cellSize; })
    .attr("width",  cellSize)
    .attr("height", cellSize)
    .on('draw', function(d) {
      d3.select(this).classed("alive", d.alive);
    })
    .on('mouseover', function(d) {
      infoBox.text(`${d.x};${d.y}`);
    })
    .on('click', function(d) {
      d.alive = !d.alive;
      d3.select(this).classed("alive", d.alive);
    });
}

